import React from "react";
import { Avatar, Card, Button } from 'antd';

const UserProfile =()=>{
    return(
        <Card
        actions={[
            <div key="twit">Jack <br/></div>,
            <div key="following">팔로잉 <br/></div>,
            <div key="follower">팔로워 <br/></div>,
        ]}>

        <Card.Meta
        avatar={<Avatar>RI</Avatar>}
        title="River"
        />
        <Button>로그아웃</Button>
        </Card>
    )
}
export default UserProfile;
